import React, { Component, useState } from 'react';
import '../App.css';
import '../css/Navbar.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Media } from 'reactstrap';
import arslan from './arslan.jpg';


class Introduction extends Component {
    render()
    {
        return (
          <div className="container mt-5">
            <div className="row">
              <Media tag="li">
              <div className="col-xs-4">
              <Media left middle>
                  <Media object width="50%" height="50%" src={arslan} alt="arslan pic" />
              </Media>
              </div>
              <div className="col-xs-4">
              <Media body className="">
                <Media heading>Introduction</Media>
                <p>My  intro</p>
              </Media>
              </div>
            </Media>
          </div>
        </div>
            // <div className="container mt-5">
            //   <div className="row">
            //     <div className="col-xs-4">
            //       <img scr={arslan}></img>
            //     </div>
            //     <div className="col-xs-8">
            //       <h1>Introduction</h1>
            //     </div>
            //   </div>

            // </div>
        );
    }
  }
export default Introduction;
